import React from 'react';
import { render } from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

import './index.css';
import App from './App';
import Beta from './translate'

render((
    <BrowserRouter>
    <Beta/>
        <App/>
    </BrowserRouter>
), document.getElementById('root'));
